import React from "react";

export const Tile = ({name, description}) => {
  return (
    <div className="tile-container">
      <p className="tile-title">{name}</p>
      <p className="tile">{description.data.phone}</p>
      <p className="tile">{description.data.email}</p>
    </div>
  );
};
